export default async function onAnswerHandler(data, pc) {
  console.log('On answer handler called', data);
  try {
    await pc.setRemoteDescription(data);
    console.log('SetRemoteDescription done');
  } catch (e) {
    console.error('set Remote description in local pc failed', e);
  }
}
